	//! Applies the Gabor filters to the image using a list of locations
	/*!
	\param img Input image
	\param GaborPoints Locations list
	\param npos Number of points in the list
	\param nfilters Number of filters to apply
	*/
	IplImage* GaborWavelet(IplImage *img, CvPoint *GaborPoints,int npos, int nfilters=16) {

		int i;

		IplImage *image;
		bool	botmp=false;

		//If the input image is float there is no problem
		if (img->depth==32)
			image=img;
		else//Aloja intermedia float
		{
			botmp=true;
			image = cvCreateImage(cvSize(img->width,img->height),32,img->nChannels);
			cvConvertScale(img,image);
		}

		//Alojo la imagen resultante en función del número de posiciones floats con un canal por filtro(32 canales máximo, uno para cada máscara)
		IplImage *output = cvCreateImage(cvSize(npos,1),32,nfilters*2);
		//Inicializo a cero
		cvSetZero(output);

		//Inicializo puntero
		float *ppf=(float *)output->imageData;

		//For the given points of filter application
		for( i = 0; i < npos; i++)
		{
			//32 canales as maximum for each point of application
				*(ppf++) = apply_mask0even(image,GaborPoints[i].y,GaborPoints[i].x);
				*(ppf++) = apply_mask1even(image,GaborPoints[i].y,GaborPoints[i].x);
				*(ppf++) = apply_mask2even(image,GaborPoints[i].y,GaborPoints[i].x);
				*(ppf++) = apply_mask3even(image,GaborPoints[i].y,GaborPoints[i].x);
				if (nfilters>4)
				{
					*(ppf++) = apply_mask4even(image,GaborPoints[i].y,GaborPoints[i].x);
					*(ppf++) = apply_mask5even(image,GaborPoints[i].y,GaborPoints[i].x);
					*(ppf++) = apply_mask6even(image,GaborPoints[i].y,GaborPoints[i].x);
					*(ppf++) = apply_mask7even(image,GaborPoints[i].y,GaborPoints[i].x);
					if (nfilters>8)
					{
						*(ppf++) = apply_mask8even(image,GaborPoints[i].y,GaborPoints[i].x);
						*(ppf++) = apply_mask9even(image,GaborPoints[i].y,GaborPoints[i].x);
						*(ppf++) = apply_mask10even(image,GaborPoints[i].y,GaborPoints[i].x);
						*(ppf++) = apply_mask11even(image,GaborPoints[i].y,GaborPoints[i].x);
						if (nfilters>12)
						{
							*(ppf++) = apply_mask12even(image,GaborPoints[i].y,GaborPoints[i].x);
							*(ppf++) = apply_mask13even(image,GaborPoints[i].y,GaborPoints[i].x);
							*(ppf++) = apply_mask14even(image,GaborPoints[i].y,GaborPoints[i].x);
							*(ppf++) = apply_mask15even(image,GaborPoints[i].y,GaborPoints[i].x);
						}
					}
				}

				*(ppf++) = apply_mask0odd(image,GaborPoints[i].y,GaborPoints[i].x);
				*(ppf++) = apply_mask1odd(image,GaborPoints[i].y,GaborPoints[i].x);
				*(ppf++) = apply_mask2odd(image,GaborPoints[i].y,GaborPoints[i].x);
				*(ppf++) = apply_mask3odd(image,GaborPoints[i].y,GaborPoints[i].x);
				if (nfilters>4)
				{
					*(ppf++) = apply_mask4odd(image,GaborPoints[i].y,GaborPoints[i].x);
					*(ppf++) = apply_mask5odd(image,GaborPoints[i].y,GaborPoints[i].x);
					*(ppf++) = apply_mask6odd(image,GaborPoints[i].y,GaborPoints[i].x);
					*(ppf++) = apply_mask7odd(image,GaborPoints[i].y,GaborPoints[i].x);
					if (nfilters>8)
					{
						*(ppf++) = apply_mask8odd(image,GaborPoints[i].y,GaborPoints[i].x);
						*(ppf++) = apply_mask9odd(image,GaborPoints[i].y,GaborPoints[i].x);
						*(ppf++) = apply_mask10odd(image,GaborPoints[i].y,GaborPoints[i].x);
						*(ppf++) = apply_mask11odd(image,GaborPoints[i].y,GaborPoints[i].x);
						if (nfilters>12)
						{
							*(ppf++) = apply_mask12odd(image,GaborPoints[i].y,GaborPoints[i].x);
							*(ppf++) = apply_mask13odd(image,GaborPoints[i].y,GaborPoints[i].x);
							*(ppf++) = apply_mask14odd(image,GaborPoints[i].y,GaborPoints[i].x);
							*(ppf++) = apply_mask15odd(image,GaborPoints[i].y,GaborPoints[i].x);
						}
					}
				}

		}

		if (botmp)
			cvReleaseImage(&image);

		return output;
	}




