	//La imagen de entrada se asume float

	float apply_mask0even(IplImage *image,  int y, int x )
	{
		float returnvalue;

		//Checks mask area to apply according to position
		int mx1 = x-( 11/2) >= 0 ? 0 : ( 11/2)-x;
		int mx2 = x+( 11/2) < image->width ? 11-1 : 11-1 - (x+( 11/2) - (image->width-1));
		int my1 = y-( 11/2) >= 0 ? 0 : ( 11/2)-y;
		int my2 = y+( 11/2) < image->height ? 11-1 : 11-1 - (y+( 11/2) - (image->height-1));
		int imagexoffset = x - 11/2  + mx1;
		int imageyoffset = y - 11/2  + my1;

		int h , k;
		returnvalue = 0;

		BYTE *pf=(BYTE *)image->imageData+imageyoffset*image->widthStep; float *ppf;

		for(k = my1; k <= my2; k++,pf+=image->widthStep)
		{
			ppf=(float *)(pf)+imagexoffset;
			for(h = mx1; h <= mx2; h++,ppf++)
			{
				returnvalue +=(float) mask0even[h+k* 11] * (*ppf);
			}
		}
		return returnvalue;
	}



